import logo from './logo.svg';
import './App.css';
import NextButton from './components/NextButton';
import ArtPieceTitle from './components/ArtPieceTitle';
import Details from './components/Details';
import ArtImage from './components/ArtImage';

function App() {
  return (
    <div>
     <NextButton/>
     <ArtPieceTitle/>
     <Details/>
     <ArtImage/>
    </div>
  )
}

export default App;
